import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' >
        <h1>  Hi, I'm  Ionut Ciornei front-end developer!</h1>
        <p className='ms-5'>frontend developer</p>
        <Image src="/img/me.jpg" alt="me" fluid />
     </Container>      
    )
};

export default Home;
